import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using its placeholder (different selector)
    const searchInput = await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type a query that triggers autocomplete
    await searchInput.click();
    await searchInput.type('iph');

    // Wait for the suggestions dropdown to appear (by class, but using :visible and text)
    await page.waitForSelector('.search-suggestions:visible', { timeout: 4000 });

    // Take screenshot of suggestions visible
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions_visible.png'));

    // Extract the suggestions text (using .suggestion-item)
    const suggestions = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion using nth-of-type
    await page.click('.suggestion-item:nth-of-type(1)');

    // Wait for the search results to load (look for heading with 'Search Results')
    await page.waitForSelector('h2:text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract the number of results from the .results-count element
    let resultsCount = null;
    try {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    } catch {}

    // Extract the titles of the first 3 products in results (using .product-title)
    let productTitles = [];
    try {
      productTitles = await page.$$eval('.products-grid .product-title', els =>
        els.slice(0, 3).map(e => e.textContent.trim())
      );
    } catch {}

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected one, verified search results.",
      extractedData: {
        suggestions,
        resultsCount,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
